import React from 'react';
import OrderStock from "../../Order/OrderStock"
import OrderChart from '';

const Dashboard = () => {
  return (
    <div className="App">
      <h1 className="text-4xl font-bold text-center mt-10">Dashboard</h1>
      <OrderStock />
      <OrderChart />
    </div>
  );
};

export default Dashboard;
